import Item from 'Item'

function ItemList({items}) {
    return(
    <>{
        
        items.length > 0 ? items.map (item => <Item key={item.id} id={item.id} title={item.title} img={item.img} price={item.price} stock={item.stock} />)
         : <p>Cargando...</p>
    }
    </>)
}

export default ItemList
